using MotorRent.Application.DTO.Entregador;
using MotorRent.Domain.Enums;
using System.Net.Http.Json;
using Xunit;

namespace MotorRent.Tests.Controllers
{
    public class EntregadorControllerTests(WebApplicationFixture fixture) : IClassFixture<WebApplicationFixture>
    {
        [Fact]
        public async Task Post_CreateValiddEntregador_StatusCreated()
        {
            // Arrange
            var entregador = new CreateEntregadorDTO(
                identificador: "entregador001",
                nome: "Nome Sobrenome",
                cnpj: "82882903000111",
                data_nascimento: DateTime.UtcNow.AddYears(-19),
                "NUMERO_CNH11",
                tipo_cnh: TipoCnhEnum.A,
                imagem_cnh: "");
            await fixture.HttpClient.DeleteAsync($"/api/entregadores/{entregador.identificador}");

            // Act
            var response = await fixture.HttpClient.PostAsJsonAsync("/api/entregadores", entregador);
            var content = await response.Content.ReadAsStringAsync();
            // Assert
            response.EnsureSuccessStatusCode();
            Assert.Equal(HttpStatusCode.Created, response.StatusCode);
            Assert.Equal(content, string.Empty);
        }

        [Fact]
        public async Task PostCnh_UpdateCnhEntregador_StatusCreated()
        {
            // Arrange
            var imagem = new UpdateEntregadorDTO(imagem_cnh: "");
            var entregador = new CreateEntregadorDTO(
                identificador: "entregador2",
                nome: "Nome Sobrenome",
                cnpj: "82882903000133",
                data_nascimento: DateTime.UtcNow.AddYears(-19),
                "NUMERO_CNH33",
                tipo_cnh: TipoCnhEnum.A,
                imagem_cnh: "");
            await fixture.HttpClient.PostAsJsonAsync("/api/entregadores", entregador);
            await Task.Delay(5000); // O ideal seria uma abordagem mais robusta para garantir que a mensagem foi processada, mas para fins de teste, um delay simples vai funcionar.

            // Act

            var response = await fixture.HttpClient.PostAsJsonAsync($"/api/entregadores/{entregador.identificador}/cnh", imagem);
            var content = await response.Content.ReadAsStringAsync();

            // Assert

            Assert.Equal(HttpStatusCode.Created, response.StatusCode);
            Assert.Equal(content, string.Empty);
        }

    }
}
